"    <div id=\"topicTitle\">",
"     Patient information: Vaccines (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vaccines-the-basics?source=topic_page\">",
"      Spanish",
