"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H393340173\">",
"      <span class=\"h1\">",
"       What are vaccines?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vaccines are treatments that prevent infections. They teach your body how to fight the germs that cause infections. Thanks to vaccines, the number of people &mdash; especially kids &mdash; who die because of infections has gone way down. Vaccines have also reduced the number of people crippled by polio and other infections that can cause permanent damage.",
"     </p>",
"     <p>",
"      Vaccines usually come in shots, but some come in nasal sprays or medicines you swallow. Vaccines are also called &ldquo;vaccinations&rdquo; or &ldquo;immunizations.&rdquo;",
"     </p>",
"     <p>",
"      Some vaccines work after just one dose. Others work only after two or more doses. Vaccines usually take a few weeks to start working.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340180\">",
"      <span class=\"h1\">",
"       Why should I get vaccinated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Getting vaccinated can help keep you from getting sick. If you do get sick, being vaccinated can also keep you from getting severely ill. Plus, being vaccinated can help protect those around you from getting sick.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340187\">",
"      <span class=\"h1\">",
"       What side effects do vaccines cause?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Often vaccines cause no side effects. When they do cause side effects, they can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Redness, mild swelling, or soreness where you got the shot",
"       </li>",
"       <li>",
"        A mild fever",
"       </li>",
"       <li>",
"        A mild rash",
"       </li>",
"       <li>",
"        Headache or body aches",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Vaccines also sometimes cause more serious side effects, such as severe allergic reactions. But serious side effects are rare.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340194\">",
"      <span class=\"h1\">",
"       When should I be vaccinated and for what?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People need different vaccines at different stages of their life:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Infants and children usually need vaccines against infections that strike at any time in life. Childhood vaccines include those against measles, mumps, rubella, and polio.",
"       </li>",
"       <li>",
"        Children older than 6 months and adults need a flu vaccine every year. Some adults also need a vaccine against the most common type of pneumonia (a lung infection). Plus, adults sometimes need vaccines that they never got as children.",
"       </li>",
"       <li>",
"        Travelers sometimes need vaccines against infections that exist in the area to which they are traveling.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340201\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, ask your doctor or nurse if you need any vaccines. Some vaccines must be given before pregnancy. Others are important to get during pregnancy. Getting the right vaccines before and during pregnancy can protect you and your baby from serious infections.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340208\">",
"      <span class=\"h1\">",
"       Do vaccines cause autism?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. After doing many careful studies, scientists have not found any link between vaccines and autism. Many years ago, one study found a link between autism and vaccines. But that study turned out to be false. It has been withdrawn.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H393340215\">",
"      <span class=\"h1\">",
"       What if I have an egg allergy?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Ask your doctor which vaccines are safe for you. Many vaccines are made in eggs, so people with egg allergies sometimes have a bad reaction to those vaccines. Still, people with mild allergies can often take egg-made vaccines.",
"     </p>",
