var title_f11_48_12045="ACC AHA HRS fascic block";
var content_f11_48_12045=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F66737%7ECARD%2F80379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F66737%7ECARD%2F80379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=17\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA/HRS guideline summary: Indications for permanent pacing in chronic bifascicular block",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I - There is evidence and/or general agreement that permanent pacing is indicated in patients with chronic bifascicular block in the following settings:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Advanced second-degree AV block or intermittent third-degree AV block. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Type II second-degree AV block. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Alternating bundle branch block. (Level of Evidence: C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IIa - The weight of evidence or opinion is in favor of the usefulness of permanent pacing in patients with chronic bifascicular block in the following settings:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Syncope not demonstrated to be due to AV block when other likely causes have been excluded, specifically ventricular tachycardia (VT). (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Incidental finding at electrophysiological study of a markedly prolonged HV interval (&ge;100 msec) in asymptomatic patients. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Incidental finding at electrophysiological study of pacing-induced infra-His block that is not physiological. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IIb - The weight of evidence or opinion is less well established for the usefulness of permanent pacing in patients with chronic bifascicular block in the following setting:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Neuromuscular diseases, such as myotonic muscular dystrophy, Erb dystrophy (limb-girdle muscular dystrophy), and peroneal muscular atrophy with bifascicular block or any fascicular block, with or without symptoms. (Level of Evidence: C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class III - There is evidence and/or general agreement that permanent pacing for chronic bifascicular block is not useful in in the following settings:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Fascicular block without AV block or symptoms. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &bull; Fascicular block with first-degree AV block without symptoms. (Level of Evidence: B)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Epstein AE, DiMarco JP, Ellenbogen KA, et al. ACC/AHA/HRS 2008 Guidelines for Device-Based Therapy of Cardiac Rhythm Abnormalities: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing Committee to Revise the ACC/AHA/NASPE 2002 Guideline Update for Implantation of Cardiac Pacemakers and Antiarrhythmia Devices): developed in collaboration with the American Association for Thoracic Surgery and Society of Thoracic Surgeons. Circulation 2008; 117:e350.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for pacing in multifascicular block",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Pacemaker necessary",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pacemaker probably necessary",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pacemaker not necessary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptomatic patients with fascicular block and significantly prolonged H-V interval by electrophysiologic study",
"       </td>",
"       <td>",
"        Patients with syncope and bifascicular or trifascicular block with other etiologies of syncope excluded",
"       </td>",
"       <td>",
"        Asymptomatic fascicular block without AV block",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptomatic patients with block distal to His at atrial paced rates of less than 100-120 bpm",
"       </td>",
"       <td>",
"        Pacing-induced block distal to His at atrial paced rates of less than 130 bpm",
"       </td>",
"       <td>",
"        Asymptomatic fascicular block and first degree AV block",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Symptomatic patients with bifascicular block and intermittent type II second degree AV block or third degree AV block",
"       </td>",
"       <td>",
"        Asymptomatic patients with fascicular block and intermittent type II second degree or third degree AV block",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
