"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Including congestive heart failure and cardiomyopathies, excluding hypertension.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Including chronic obstructive pulmonary disease, emphysema, and asthma.",
"     <br/>",
"     &Delta; All adults aged &ge;65 years should receive a dose of PPSV23 even if they were vaccinated when they were less than 65 years of age; however, a minimum interval of 5 years between PPSV23 doses should be maintained. Those who are receiving PPSV23 for the first time at or after age 65 should receive only a single dose (and do not require revaccination).",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     Patients &lt;65 years of age who have functional or anatomic asplenia or who are immunocompromised should be revaccinated one time 5 years after the initial dose, and again at or after age 65 (and at least 5 years after the previous dose).",
"     <br/>",
"     &sect; Includes B- (humoral) or T-lymphocyte deficiency, complement deficiencies (particularly C1, C2, C3, and C4 deficiencies), and phagocytic disorders (excluding chronic granulomatous disease).",
"     <br/>",
"     &yen; Diseases requiring treatment with immunosuppressive drugs, including long-term systemic glucocorticoids and radiation therapy.",
"    </div>",
