" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 586px\">",
"   <div class=\"ttl\">",
"    The osmotic fragility test in hereditary spherocytosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 566px; height: 354px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure shows results of an incubated osmotic fragility test performed on red cells from an adult patient with hereditary spherocytosis, showing markedly increased osmotic fragility. Note that the patient's red cells were &gt;60 percent hemolyzed at a saline concentration (0.7 g/dL) that did not cause any osmotic lysis in normal, incubated red cells.",
